function App() {

  const dispatch = useDispatch();
  const [isLoaded, setIsLoaded] = useState(false);
  useEffect(() => {
    dispatch(sessionActions.restoreUser()).then(() => setIsLoaded(true));
  }, [dispatch]);

  const history = useHistory()
  const redirectToSongs = () => {
    history.push('/songs')
  }
  return (
    <h1>Hello from App</h1>
  );
}

export default App;
